      encoding: UTF-8
      string: '{"definition":"http://mmisw.org/ont/cf/parameter/downwelling_shortwave_flux_in_air","description":"Downwelling
        radiation is radiation from above. It does not mean \"net downward\". The
        sign convention is that \"upwelling\" is positive upwards and \"downwelling\"
        is positive downwards. The term \"shortwave\" means shortwave radiation. When
        thought of as being incident on a surface, a radiative flux is sometimes called
        \"irradiance\". In addition, it is identical with the quantity measured by
        a cosine-collector light-meter and sometimes called \"vector irradiance\".
